import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Body(props) {
  return (
    <div>
      <Container fluid="true" style={{ marginLeft: "1rem" }}>
        <Row className="justify-content-center py-5">
          <Col md={8} sm={8}>
            {props.title && (
              <div className="display-4 font-weight-bold">{props.title}</div>
            )}

            {props.subTitle && (
              <div className="display-6 font-weigth-light">
                {props.subTitle}
              </div>
            )}
            {props.text && (
              <div className="lead font-weight-light">
                press <kbd className="grey">cmd</kbd> <kbd>k</kbd>/
                <kbd>ctrl</kbd> <kbd>k</kbd>to learn more about me
              </div>
            )}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Body;
